import React from 'react';

const Footer = () => {
    return (
        <footer>
            <nav class="navbar bg-dark">
                <div class="container-fluid bg-warning">
                    <span class="navbar-text text-light mt-[10]">
                        Designed by Abduvakhob
                    </span>
                </div>
            </nav>
        </footer>
    );
}




export default Footer;
